        Description</Source><Content>In Seven Men, New York Times best-selling author
        Eric Metaxas presents seven exquisitely crafted short portraits of widely
        known-but not well understood-Christian men, each of whom uniquely showcases
        a commitment to live by certain virtues in the truth of the gospel. Written
        in a beautiful and engaging style, Seven Men addresses what it means (or should
        mean) to be a man today, at a time when media and popular culture present
        images of masculinity that are not the picture presented in Scripture and
        historic civil life. What does it take to be a true exemplar as a father,
        brother, husband, leader, coach, counselor, change agent, and wise man? What
        does it mean to stand for honesty, courage, and charity, especially at times
        when the culture and the world run counter to those values? Each of the seven
        biographies represents the life of a man who experienced the struggles and
        challenges to be strong in the face of forces and circumstances that would
        have destroyed the resolve of lesser men. Each of the seven men profiled-George
        Washington, William Wilberforce, Eric Liddell, Dietrich Bonhoeffer, Jackie
        Robinson, John Paul II, and Charles Colson - call the reader to a more elevated
        walk and lifestyle, one that embodies the gospel in the world around us.</Content><IsLinkSuppressed>0</IsLinkSuppressed></EditorialReview></EditorialReviews></Item></Items></ItemSearchResponse>'
